selector_to_html = {"a[href=\"https://en.wikipedia.org/wiki/Inductance\"]": "<img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/0/0d/VFPt_Solenoid_correct2.svg/330px-VFPt_Solenoid_correct2.svg.png\" alt=\"Wikipedia thumbnail\" style=\"float:left; margin-right:10px;\"><p><b>Inductance</b> is the tendency of an electrical conductor to oppose a change in the electric current flowing through it. The electric current produces a magnetic field around the conductor. The magnetic field strength depends on the magnitude of the electric current, and therefore follows any changes in the magnitude of the current. From Faraday's law of induction, any change in magnetic field through a circuit induces an electromotive force (EMF) (voltage) in the conductors, a process known as electromagnetic induction. This induced voltage created by the changing current has the effect of opposing the change in current. This is stated by Lenz's law, and the voltage is called <i>back EMF</i>.</p>", "a[href^=\"https://en.wikipedia.org/wiki/Inductance#\"]": "<img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/0/0d/VFPt_Solenoid_correct2.svg/330px-VFPt_Solenoid_correct2.svg.png\" alt=\"Wikipedia thumbnail\" style=\"float:left; margin-right:10px;\"><p><b>Inductance</b> is the tendency of an electrical conductor to oppose a change in the electric current flowing through it. The electric current produces a magnetic field around the conductor. The magnetic field strength depends on the magnitude of the electric current, and therefore follows any changes in the magnitude of the current. From Faraday's law of induction, any change in magnetic field through a circuit induces an electromotive force (EMF) (voltage) in the conductors, a process known as electromagnetic induction. This induced voltage created by the changing current has the effect of opposing the change in current. This is stated by Lenz's law, and the voltage is called <i>back EMF</i>.</p>", "a[href=\"#question-3\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 3<a class=\"headerlink\" href=\"#question-3\" title=\"Link to this heading\">#</a></h3><p>We can get a qualitative idea of the step response  by looking at the static gain and poles of the transfer function <a class=\"reference internal\" href=\"#equation-eq-lec1-ex1-theta\">(3)</a>.</p><p>We compute the <strong>poles</strong> as the roots of the denominator, i.e. by solving <span class=\"math notranslate nohighlight\">\\(s(s+\\alpha) = 0\\)</span>. We have two poles:</p>", "a[href=\"#solution\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Solution<a class=\"headerlink\" href=\"#solution\" title=\"Link to this heading\">#</a></h2><p>In the Laplace domain, the time derivative operator is equivalent to multiplying by <span class=\"math notranslate nohighlight\">\\(s\\)</span>. Hence, <span class=\"math notranslate nohighlight\">\\(\\frac{d}{dt} i(t) \\rightarrow s I(s)\\)</span> and <span class=\"math notranslate nohighlight\">\\(\\frac{d}{dt} \\theta(t) \\rightarrow s \\Theta(s)\\)</span>.</p>", "a[href=\"#id1\"]": "<figure class=\"align-center\" id=\"id1\">\n<img alt=\"../_images/ex1.png\" src=\"../_images/ex1.png\"/>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 2 </span><span class=\"caption-text\">Schematic of the motor (courtesy of <a class=\"reference external\" href=\"https://uppsala.instructure.com/courses/102131/files/7991063?module_item_id=1296223\"><em>Exercise Manual for Automatic Control</em></a>)</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#question-2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2<a class=\"headerlink\" href=\"#question-2\" title=\"Link to this heading\">#</a></h3><p>Moving the balance of momentum from the time domain, equation <a class=\"reference internal\" href=\"#equation-eq-lec1-ex1-momentum\">(2)</a> to the Laplace domain we get</p>", "a[href=\"#equation-eq-lec1-ex1-theta\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-lec1-ex1-theta\">\n\\[\n\\Theta(s) =  \\frac{k_o}{s \\left(s + \\alpha\\right)} U(s)\n\\]</div>", "a[href=\"#equation-eq-lec1-ex1-momentum\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-lec1-ex1-momentum\">\n\\[ \nJ \\ddot{\\theta} = -f_s \\dot{\\theta} + M =  -f_s \\dot{\\theta}  + k_a i(t)\n\\]</div>", "a[href=\"#question-1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>From the Ohm\u2019s law <a class=\"reference internal\" href=\"#equation-eq-lec1-ex1-ohm\">(1)</a>, we have that <span class=\"math notranslate nohighlight\">\\(U(s) = R_a I(s) + L_a s I(s) + k_v s \\Theta(s)\\)</span>.\nSolving by <span class=\"math notranslate nohighlight\">\\(I(s)\\)</span>, and recalling that <span class=\"math notranslate nohighlight\">\\(L_a = 0\\)</span>, we get</p>", "a[href=\"#solutions-of-exercise-1-1\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Solutions of Exercise 1.1<a class=\"headerlink\" href=\"#solutions-of-exercise-1-1\" title=\"Link to this heading\">#</a></h1><p>The scheme above is a DC motor  characterized by the following physical relationships. The rotating axis is described by</p>", "a[href=\"#equation-eq-lec1-ex1-ohm\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-lec1-ex1-ohm\">\n\\[\nu(t) = R_a i(t) + L_a \\frac{d}{dt} i(t) + v(t)\n\\]</div>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: false,
                placement: 'auto-start', maxWidth: 500, interactive: true, boundary: document.body, appendTo: document.body,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {var isFirefox=typeof InstallTrigger!=='undefined';if(isFirefox&&window.MathJax&&MathJax.startup&&MathJax.startup.output&&MathJax.startup.output.name==="SVG"){const svgs=instance.popper.querySelectorAll('svg');svgs.forEach(svg=>{let bbox=svg.getBBox(),x=bbox.x,y=bbox.y,width=bbox.width,height=bbox.height;svg.setAttribute('width',width);svg.setAttribute('height',height);svg.setAttribute('viewBox',`${x} ${y} ${width} ${height}`);});let rescale=0.015;svgs.forEach(svg=>{let bbox=svg.getBBox(),width=bbox.width,height=bbox.height;svg.setAttribute('width',width*rescale);svg.setAttribute('height',height*rescale);});}});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
